/**
 * The resize direction options: 'east' | 'west'
 */
export var PaneResizeDirection;
(function (PaneResizeDirection) {
    PaneResizeDirection["east"] = "east";
    PaneResizeDirection["west"] = "west";
})(PaneResizeDirection || (PaneResizeDirection = {}));
